import zlib

from arksavetools.arkBinaryData import ArkBinaryData
from arksavetools.arkPropertyContainer import ArkPropertyContainer
from arksavetools.arkSaveContext import SaveContext
from arksavetools.config import logger, CustomFormatter


class ArkCryopod(ArkPropertyContainer):
    def __init__(self):
        super().__init__()
        self.compressed = False

    def int_to_byte(self, int_array):
        byte_array = b''
        for a in int_array:
            byte_array += a.to_bytes(1, 'little')
        return byte_array

    def inflate(self,byte_array):
        try:
            inflated_data = self.repad_data(zlib.decompress(byte_array[12:]))
            data = ArkBinaryData(byte_array[:12], SaveContext())
            self.version = data.read_int() - 1024
            self.decompressed_size = data.read_int()
            self.name_table_offset = data.read_int()
            self.compressed = True
            data = ArkBinaryData(inflated_data, SaveContext())
            logger.warning(inflated_data.hex(' '))
        except:
            data = ArkBinaryData(byte_array, SaveContext())
            data.expect(6,data.read_int())
        return data

    def read_cryo_data(self, byte_buffer):
        self.byte_buffer = self.inflate(self.int_to_byte(byte_buffer))
        #logger.warning(f'{data}')
        if not self.compressed:
            self.read_properties(self.byte_buffer)

    def repad_data(self, byte_buffer):
        padded_data = b''
        prev_i = 0
        pos = -1
        for i in byte_buffer:
            pos += 1
            if i == 240:    # F0 means dont change next char
                logger.debug(f'position : {pos}, Ignoring : {hex(byte_buffer[pos+1])} because of {hex(i)}')
                prev_i = i
                continue
            if i == 241:    # F1 means do some bitswapping. Havent seen yet
                #logger.debug(f'position : {pos}, Found : {hex(byte_buffer[pos+1])} because of {hex(i)}')
                prev_i = i
                continue
            if i >= 243 and i <= 255 and prev_i != 240:     # For F2 - FF add 00 to the data depending on number
                #logger.debug(f'position : {pos}, Converting : {hex(i)}')
                for _ in range(i - 240):
                    padded_data += b'\x00'
            else:
                padded_data += i.to_bytes()
            prev_i = i
        logger.error(f'padded data length : {len(padded_data)}')
        return padded_data

    def read_names(self, pos):
        self.byte_buffer.set_position(pos)
        count = self.byte_buffer.read_int()
        names = []
        for i in range(count):
            name = self.byte_buffer.read_single_name()
            #logger.debug(f'{i} : {name}')
            names.append(name)
        return names

    def read_floats(self, data):
        self.statis_time = data[0]
        self.next_cuddle = data[1]
        self.next_mating = data[2]
        self.male_mutations = data[3]
        self.female_mutations = data[4]
        self.imprint_quality = data[5]
        self.stasis_utc = data[6]


        pass


